// src/components/Booking.js
import { Link } from "react-router-dom";
import "./Booking.css"; // Ensure you create this CSS file

const Booking = () => {
  return (
    <div className="booking-container">
      <h1 className="booking-title">Choose Your Dining Experience</h1>
      <div className="grid-container">
        {/* AC Table Section */}
        <div className="grid-item">
          <Link to="/ac-tables">
            <img src="data:image/jpeg;base64," alt="AC Tables" className="grid-image" />
            <div className="overlay">
              <h2>AC Tables</h2>
            </div>
          </Link>
          <Link to="/ac-tables" className="explore-button">Explore AC Tables</Link>
        </div>

        {/* Non-AC Table Section */}
        <div className="grid-item">
          <Link to="/non-ac-tables">
            <img src="data:image/jpeg;base64," alt="Non-AC Tables" className="grid-image" />
            <div className="overlay">
              <h2>Non-AC Tables</h2>
            </div>
          </Link>
          <Link to="/non-ac-tables" className="explore-button">Explore Non-AC Tables</Link>
        </div>
      </div>
    </div>
  );
};

export default Booking;